window.bookSummaryJSON = "<p><i>Duet narration with Stella Hunter and Connor Crais</i> </p> <p><b><i>An unexpected assignment, a jealous ex, and a game-changing serum trigger unanticipated risks in a dangerous race against the clock.</i></b></p> <p>Rory Costas, Arcane Transporter, finds herself babysitting a trio of badass Arbiters, including the highly distracting Zev Aslanov, as they track down a magical serum that shouldn't exist and a killer who's targeting the researchers behind it.</p> <p>As if that wasn't enough for the fledgling Arcane entrepreneur to handle, the growing attraction to Zev is shifting into potential relationship territory, a terrifying road that could expose her lifelong secret behind her magical ability. But that's not the only hazard ahead. One of the Arbiters is Zev's ex-girlfriend, and she's not ready to put Zev in her rearview just yet.</p> <p>Dodging Family rivalries and mad scientists out for blood, Rory is blindsided by an unexpected turn, and it's going to take more than magic to get her back on track.</p> <p><i>Claim your ticket for this wild ride and grab your copy of this fast-paced, adrenaline-laced urban fantasy adventure!</i></p>"; 
